    function onSwapExactTokensForTokens(
        IRequiemSwap.QSwapStep[] memory params,
        uint256 amountIn,
        uint256 amountOutMin,
        address to,
        uint256 deadline
    ) public virtual ensure(deadline) returns (uint256 amountLast) {
        amountLast = amountIn;
        TransferHelper.safeTransferFrom(params[0].tokenIn, msg.sender, params[0].pool, amountIn);
        for (uint256 i = 0; i < params.length; i++) {
            address _to = i == params.length - 1 ? to : params[i + 1].pool;
            if (params[i].structure == 0) {
                uint256 _amountIn = amountLast;
                amountLast = IRequiemSwap(params[i].pool).calculateSwapGivenIn(params[i].tokenIn, params[i].tokenOut, amountLast);
                IRequiemSwap(params[i].pool).onSwapGivenIn(params[i].tokenIn, params[i].tokenOut, _amountIn, amountLast, _to);
            } else {
                amountLast = IRequiemSwap(params[i].pool).onSwapGivenIn(params[i].tokenIn, params[i].tokenOut, amountLast, 0, _to);
            }
        }
        require(amountOutMin <= amountLast, "INSUFFICIENT_OUTPUT");
    }

    function onSwapTokensForExactTokens(
        IRequiemSwap.QSwapStep[] memory params,
        uint256 amountOut,
        uint256 amountInMax,
        address to,
        uint256 deadline
    ) external virtual ensure(deadline) returns (uint256[] memory amounts) {
        amounts = new uint256[](params.length + 1);
        amounts[params.length] = amountOut;
        for (uint256 i = amounts.length - 1; i > 0; i--) {
            amounts[i - 1] = IRequiemSwap(params[i - 1].pool).calculateSwapGivenOut(params[i - 1].tokenIn, params[i - 1].tokenOut, amounts[i]);
        }
        require(amounts[0] <= amountInMax, "EXCESSIVE_INPUT");
        TransferHelper.safeTransferFrom(params[0].tokenIn, msg.sender, params[0].pool, amounts[0]);

        for (uint8 i = 0; i < params.length; i++) {
            address _to = i == params.length - 1 ? to : params[i + 1].pool;
            IRequiemSwap(params[i].pool).onSwapGivenIn(params[i].tokenIn, params[i].tokenOut, amounts[i], params[i].structure == 0 ? amounts[i + 1] : 0, _to);
        }
    }

    function onSwapExactETHForTokens(
        IRequiemSwap.MultiSwapStep[] memory params,
        uint256 amountOutMin,
        address to,
        uint256 deadline
    ) external payable virtual ensure(deadline) returns (uint256[] memory amounts) {
        amounts = _calculateAmountOut(WETH, params[0].path[params[0].path.length - 1], msg.value, params[0].pools);
        transferETHTo(amounts[0], params[0].pools[0]);
        _swap(WETH, amounts, params[0].pools, to);
        uint256 amountLast = amounts[amounts.length - 1];
        for (uint256 i = 1; i < params.length; i++) {
            address _to = i == params.length - 1 ? to : params[i + 1].pools[0];
            if (params[i].swapStructureId == 0) {
                amounts = _calculateAmountOut(params[i].path[0], params[i].path[params[i].path.length - 1], amountLast, params[i].pools);
                _swap(params[i].path[0], amounts, params[i].pools, _to);
                amountLast = amounts[amounts.length - 1];
            } else {
                amountLast = IRequiemSwap(params[i].pools[0]).onSwapGivenIn(params[i].path[0], params[i].path[1], amountLast, 0, _to);
            }
        }
        require(amountOutMin <= amountLast, "INSUFFICIENT_OUTPUT");
    }

    function onSwapTokensForExactETH(
        IRequiemSwap.MultiSwapStep[] memory params,
        uint256 amountOut,
        uint256 amountInMax,
        address to,
        uint256 deadline
    ) external virtual ensure(deadline) returns (uint256[][] memory allAmounts) {
        uint256 _amountOut = amountOut;
        for (uint256 i = params.length - 1; i > 0; i--) {
            if (params[i].swapStructureId == 0) {
                allAmounts[i] = _calculateAmountIn(params[i].path[0], params[i].path[params[i].path.length - 1], _amountOut, params[i].pools);
                _amountOut = allAmounts[i][0];
            } else {
                // _amountOut = IRequiemSwap(params[i].pools[0]).calculateSwapOut(params[i].path[0], params[i].path[1], _amountOut);
            }
        }
        require(_amountOut <= amountInMax, "EXCESSIVE_INPUT");

        TransferHelper.safeTransferFrom(params[0].path[0], msg.sender, params[0].pools[0], allAmounts[0][0]);
        for (uint256 i = 0; i < params.length; i++) {
            address _to = i == params.length - 1 ? address(this) : params[i + 1].pools[0];
            if (params[i].swapStructureId == 0) {
                _swap(params[i].path[0], allAmounts[i], params[i].pools, _to);
            } else {
                IRequiemSwap(params[i].pools[0]).onSwapGivenIn(params[i].path[0], params[i].path[1], allAmounts[i][0], 0, _to);
            }
        }
        transferAll(ETH_ADDRESS, to, amountOut);
    }

    function swapTokensForExactTokens(
        address tokenIn,
        address tokenOut,
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external virtual override ensure(deadline) returns (uint256[] memory amounts) {
        amounts = _validateAmountIn(tokenIn, tokenOut, amountOut, amountInMax, path);

        TransferHelper.safeTransferFrom(tokenIn, msg.sender, path[0], amounts[0]);
        _swap(tokenIn, amounts, path, to);
    }

    function swapExactETHForTokens(
        address tokenOut,
